  false,\n\t\"url\": null,\n\t\"notes\": \"The 2015 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Mastern                                 Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). These boundary
  files aren                                 specifically designed for small-scale
  thematic mapping. When possible, generalization is performed with the intent to
  maintain then                                 hierarchical relationships among geographies
  and to maintain the alignment of geographies within a file set for a given year.n
  \                                Geographic areas may not align with the same areas
  from another year. Some geographies are available as nation-based files while othersn
  \                                are available only as state-based files.nn                                 Combined
  Statistical Areas (CSAs) are defined by the Office of Management and Budget (OMB)
  and consist of two or more adjacent Coren                                 Based
  Statistical Areas (CBSAs) that have significant employment interchanges.  The CBSAs
  that combine to create a CSA retain separaten                                 identities
  within the larger CSA.  Because CSAs represent groupings of CBSAs, they should not
  be ranked or compared with individualn                                 CBSAs.n            \",\n\t\"license_title\":
